import React from 'react';
import Link from 'next/link';

const Post = ({ post }) => {
    return (
        <>
            {/* <Link href="/posts/[id]" as={`/posts/${post.id}`}> */}
            {post.title}
            {/* </Link> */}
        </>
    );
};

export default Post;
